package ee.tuleva.onboarding.epis.response

import ee.tuleva.onboarding.epis.EpisMessageType
import ee.tuleva.onboarding.mandate.processor.MandateProcessResult
import spock.lang.Specification

import javax.jms.Message

class EpisMessageResponseHandlerSpec extends Specification {

    EpisMessageResponseReader mandateMessageResponseReader = Mock(EpisMessageResponseReader)
    EpisMessageResponseHandler service =
            new EpisMessageResponseHandler(mandateMessageResponseReader)

    def "GetMandateProcessResponse: Handle error response"() {
        given:
        mandateMessageResponseReader.getText(_ as Message) >> errorMessageText
        when:
        MandateProcessResult result = service.getMandateProcessResponse(Mock(Message))
        then:
        result.processId == "ccf4ea436daf48e7a86c7a47954f5e2c"
        result.isSuccessful() == false
        result.errorCode.get() == 40551
    }

    def "GetMandateProcessResponse: Handle success response"() {
        given:
        mandateMessageResponseReader.getText(_ as Message) >> applicationProcessResponseMessage
        when:
        MandateProcessResult result = service.getMandateProcessResponse(Mock(Message))
        then:
        result.processId == "20d45002ccb044e181ec61436503b33f"
        result.isSuccessful() == true
        result.errorCode.isPresent() == false
    }

    def "GetMandateProcessResponse: Handle unknwown response"() {
        given:
        mandateMessageResponseReader.getText(_ as Message) >> "Unknown response"
        when:
        MandateProcessResult result = service.getMandateProcessResponse(Mock(Message))
        then:
        thrown Exception
    }

    def "GetMessageType: Gets message types correct"() {
        given:
        mandateMessageResponseReader.getText(_ as Message) >> messageText

        when:
        EpisMessageType episMessageType = service.getMessageType(Mock(Message))

        then:
        episMessageType == messageType

        where:
        messageText | messageType
        applicationProcessResponseMessage | EpisMessageType.APPLICATION_PROCESS
        applicationListResponseMessage | EpisMessageType.LIST_APPLICATIONS
    }

    def "GetApplicationListResponse:"() {
        given:
        mandateMessageResponseReader.getText(_ as Message) >> applicationListResponseMessage

        when:
        EpisApplicationListResponse episApplicationListResponse =
                service.getApplicationListResponse(Mock(Message))

        then:
        episApplicationListResponse.id != null
        episApplicationListResponse.applications.size() > 0
    }

